const { PDFDocument, rgb, degrees, layoutMultilineText } = PDFLib;

const DejaVuSerifCondensedTTF = '';
const DejaVuSerifCondensedBoldTTF = '';
const EanGnivcTTF = '';
const GabisTTF = '';

const typesLetters = {
    top: 'A',
    center: 'B',
    bottom: 'C'
};

const materialsLetters = {
    'шкіра': 'I',
    'шкіра з покриттям': 'G',
    'текстиль': 'F',
    'інші матеріали': 'D',
    'текстиль + інші матеріали': 'E',
    'текстиль + шкіра': 'H',
    'шкіра + інші матеріали': 'J'
};

const pageWidth = 58;
const pageHeight = 40;
const padding = {
    left: 2,
    right: 2,
    top: 1.5,
    bottom: 1.5
};
const pdfDPI = 72;

function getMm(px) {
    return Math.floor((px * 25.4) / pdfDPI);
}

function getPx(mm) {
    return Math.floor(mm * (pdfDPI / 25.4));
}

const pageWidthPx = getPx(pageWidth);
const pageHeightPx = getPx(pageHeight);
const paddingPx = {
    left: getPx(padding.left),
    right: getPx(padding.right),
    top: getPx(padding.top),
    bottom: getPx(padding.bottom)
};

const maxWidthPx = pageWidthPx - paddingPx.left - paddingPx.right;

async function genGabisBarcode(barcodes) {
    const pdfDoc = await PDFDocument.create();
    
    pdfDoc.registerFontkit(fontkit);
    const DejaVuSerifCondensedFont = await pdfDoc.embedFont(DejaVuSerifCondensedTTF);
    const DejaVuSerifCondensedBoldFont = await pdfDoc.embedFont(DejaVuSerifCondensedBoldTTF);
    const EanGnivcFont = await pdfDoc.embedFont(EanGnivcTTF);
    const GabisFont = await pdfDoc.embedFont(GabisTTF);
    
    pdfDoc.setTitle('Друк цінників', { showInWindowTitleBar: true });
    pdfDoc.setLanguage('uk');
    
    let barcodesPages = [];
    for(let i = 0; i < barcodes.length; i++) {
        if(barcodesPages[barcodes[i].barcode] === undefined) {
            barcodesPages[barcodes[i].barcode] = i;
            const page = pdfDoc.addPage([pageWidthPx, pageHeightPx]);
            
            /* barcode draw */
            const barcodeFontSize = 34;
            const barcodeWidth = EanGnivcFont.widthOfTextAtSize(barcodes[i].barcode, barcodeFontSize);
            page.drawText(barcodes[i].barcode, {
                x: 140,
                y: pageHeightPx - paddingPx.top,
                size: barcodeFontSize,
                font: EanGnivcFont,
                color: rgb(0, 0, 0),
                rotate: degrees(-90)
            });
            
            /* Gabis images draw */
            const gabisText = typesLetters.top + materialsLetters[barcodes[i].top] + typesLetters.center + materialsLetters[barcodes[i].center] + typesLetters.bottom + materialsLetters[barcodes[i].bottom];
            const gabisTextWidth = GabisFont.widthOfTextAtSize(gabisText, 1);
            const gabisTextSize = maxWidthPx / gabisTextWidth;
            const gabisTextHeight = GabisFont.heightAtSize(gabisTextSize);
            page.drawText(gabisText, {
                x: paddingPx.left,
                y: paddingPx.bottom + 2,
                size: gabisTextSize,
                font: GabisFont,
                color: rgb(0, 0, 0)
            });
            
            /* Розмір */
            const circleRadius = 14;
            page.drawCircle({
                x: 108,
                y: pageHeightPx - paddingPx.top - circleRadius,
                size: circleRadius,
                borderWidth: 2,
                borderColor: rgb(0, 0, 0),
                color: rgb(1, 1, 1)
            });
            page.drawText(barcodes[i].size, {
                x: 96,
                y: pageHeightPx - paddingPx.top - circleRadius - 7,
                size: 19,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            /* Колір */
            const colorText = "Колір:";
            const colorTextSize = 6.5;
            const colorTextWidth = DejaVuSerifCondensedBoldFont.widthOfTextAtSize(colorText, colorTextSize);
            const colorTextHeight = DejaVuSerifCondensedBoldFont.heightAtSize(colorTextSize);
            page.drawText(colorText, {
                x: paddingPx.left,
                y: pageHeightPx - paddingPx.top - 7,
                size: colorTextSize,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            page.drawText(barcodes[i].color, {
                x: paddingPx.left + colorTextWidth + 2,
                y: pageHeightPx - paddingPx.top - 7,
                size: 10,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            /* артикул + код */
            const artikleText = "артикул:";
            const codeText = "код:";
            const artikleCodeSize = 6;
            const artikleTextWidth = DejaVuSerifCondensedFont.widthOfTextAtSize(artikleText, artikleCodeSize);
            const artikleCodeHeight = DejaVuSerifCondensedFont.heightAtSize(artikleCodeSize);
            
            page.drawText(artikleText, {
                x: paddingPx.left,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight,
                size: artikleCodeSize,
                font: DejaVuSerifCondensedFont,
                color: rgb(0, 0, 0)
            });
            
            const artikleWidth = DejaVuSerifCondensedBoldFont.widthOfTextAtSize(barcodes[i].artikle, artikleCodeSize);
            page.drawText(barcodes[i].artikle, {
                x: paddingPx.left + artikleTextWidth + 2,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight,
                size: artikleCodeSize,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            const codeTextWidth = DejaVuSerifCondensedFont.widthOfTextAtSize(codeText, artikleCodeSize);
            page.drawText(codeText, {
                x: paddingPx.left + artikleTextWidth + artikleWidth + 5,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight,
                size: artikleCodeSize,
                font: DejaVuSerifCondensedFont,
                color: rgb(0, 0, 0)
            });
            
            page.drawText(barcodes[i].code, {
                x: paddingPx.left + artikleTextWidth + artikleWidth + codeTextWidth + 7,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight,
                size: artikleCodeSize,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            /* країна-виробник */
            const countryText = "країна-виробник:";
            const countrySize = 6;
            const countryTextWidth = DejaVuSerifCondensedFont.widthOfTextAtSize(countryText, countrySize);
            const countryHeight = DejaVuSerifCondensedFont.heightAtSize(countrySize);
            
            page.drawText(countryText, {
                x: paddingPx.left,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight,
                size: countrySize,
                font: DejaVuSerifCondensedFont,
                color: rgb(0, 0, 0)
            });
            
            page.drawText(barcodes[i].country, {
                x: paddingPx.left + countryTextWidth + 2,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight,
                size: countrySize,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            /* дата виробу */
            const dateText = "Дата виробу:";
            const dateSize = 6;
            const dateHeight = DejaVuSerifCondensedBoldFont.heightAtSize(dateSize);
            
            page.drawText(dateText + " " + barcodes[i].date, {
                x: paddingPx.left,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight - countryHeight,
                size: dateSize,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            /* Виробник */
            const supplierText = "Виробник:";
            const supplierSize = 6;
            const supplierTextWidth = DejaVuSerifCondensedBoldFont.widthOfTextAtSize(supplierText, supplierSize);
            const supplierHeight = DejaVuSerifCondensedBoldFont.heightAtSize(supplierSize);
            
            page.drawText(supplierText, {
                x: paddingPx.left,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight - countryHeight - dateHeight,
                size: supplierSize,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            page.drawText(barcodes[i].supplier, {
                x: paddingPx.left + supplierTextWidth + 2,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight - countryHeight - dateHeight,
                size: supplierSize,
                font: DejaVuSerifCondensedFont,
                color: rgb(0, 0, 0)
            });
            
            /* Імпортер */
            const importerText = "Імпортер:";
            const importerTextSize = 6;
            const importerTextWidth = DejaVuSerifCondensedBoldFont.widthOfTextAtSize(importerText, importerTextSize);
            const importerHeight = DejaVuSerifCondensedBoldFont.heightAtSize(importerTextSize);
            
            page.drawText(importerText, {
                x: paddingPx.left,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight - countryHeight - dateHeight - supplierHeight,
                size: importerTextSize,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            const importerWidth = DejaVuSerifCondensedFont.widthOfTextAtSize(barcodes[i].importer, 1);
            const importerSize = (maxWidthPx - importerTextWidth - 2 - barcodeFontSize) / importerWidth;
            
            page.drawText(barcodes[i].importer, {
                x: paddingPx.left + importerTextWidth + 2,
                y: pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight - countryHeight - dateHeight - supplierHeight,
                size: importerSize,
                font: DejaVuSerifCondensedFont,
                color: rgb(0, 0, 0)
            });
            
            /* ціна */
            const priceText = "ціна";
            const grnText = "грн.";
            const priceGrnTextSize = 12;
            const priceTextWidth = DejaVuSerifCondensedFont.widthOfTextAtSize(priceText, priceGrnTextSize);
            
            page.drawText(priceText, {
                x: paddingPx.left,
                y: pageHeightPx - paddingPx.top - barcodeWidth - 2,
                size: priceGrnTextSize,
                font: DejaVuSerifCondensedFont,
                color: rgb(0, 0, 0)
            });
            
            const grnTextWidth = DejaVuSerifCondensedFont.widthOfTextAtSize(grnText, priceGrnTextSize);
            page.drawText(grnText, {
                x: pageWidthPx - paddingPx.right - barcodeFontSize - grnTextWidth,
                y: pageHeightPx - paddingPx.top - barcodeWidth - 2,
                size: priceGrnTextSize,
                font: DejaVuSerifCondensedFont,
                color: rgb(0, 0, 0)
            });
            
            const maxPriceSize = 22;
            const maxPriceWidth = maxWidthPx - barcodeFontSize - grnTextWidth - priceTextWidth;
            const priceWidth = DejaVuSerifCondensedBoldFont.widthOfTextAtSize(barcodes[i].price, 1);
            const priceSize = ((maxPriceWidth / priceWidth) <= maxPriceSize) ? (maxPriceWidth / priceWidth) : maxPriceSize;            
            const priceRealWidth = DejaVuSerifCondensedBoldFont.widthOfTextAtSize(barcodes[i].price, priceSize);
            const priceHeight = DejaVuSerifCondensedBoldFont.heightAtSize(priceSize);
            const priceHeightMax = DejaVuSerifCondensedBoldFont.heightAtSize(maxPriceSize);
            page.drawText(barcodes[i].price, {
                x: paddingPx.left + priceTextWidth + (maxPriceWidth / 2) - (priceRealWidth / 2),
                y: pageHeightPx - paddingPx.top - barcodeWidth - 2,
                size: priceSize,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            /* назва товару */
            const minNameSize = 4;
            let nameSize, nameContainerWidth, nameHeight, multiText;
            nameSize = 8.25;
            do {
                nameSize = nameSize - 0.25;
                nameContainerWidth = maxWidthPx - barcodeFontSize;
                nameHeight = DejaVuSerifCondensedBoldFont.heightAtSize(nameSize);
                multiText = layoutMultilineText(barcodes[i].name, {
                    alignment: 'center', 
                    font: DejaVuSerifCondensedBoldFont,
                    fontSize: nameSize,  
                    lineHeight: nameHeight,
                    bounds: {
                        width: nameContainerWidth,
                        height: nameHeight * 2
                    }
                });
            } while(multiText.lines.length > 2);
            
            const nameFirstLine = multiText.lines[0].text;
            const nameFirstLineWidth = DejaVuSerifCondensedBoldFont.widthOfTextAtSize(nameFirstLine, nameSize);
            const nameFirstLineY = multiText.lines.length == 2 ? (pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight - countryHeight - dateHeight - supplierHeight - importerHeight - nameHeight / 2) : (pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight - countryHeight - dateHeight - supplierHeight - importerHeight - nameHeight);
            page.drawText(nameFirstLine, {
                x: paddingPx.left + (nameContainerWidth / 2) - (nameFirstLineWidth / 2),
                y: nameFirstLineY,
                size: nameSize,
                lineHeight: nameHeight,
                maxWidth: nameContainerWidth,
                font: DejaVuSerifCondensedBoldFont,
                color: rgb(0, 0, 0)
            });
            
            if(multiText.lines.length == 2) {
                const nameSecondLine = multiText.lines[1].text;
                const nameSecondLineWidth = DejaVuSerifCondensedBoldFont.widthOfTextAtSize(nameSecondLine, nameSize);
                const nameSecondLineY = pageHeightPx - paddingPx.top - 7 - colorTextHeight - artikleCodeHeight - countryHeight - dateHeight - supplierHeight - importerHeight - nameHeight / 2 - nameHeight;
                page.drawText(nameSecondLine, {
                    x: paddingPx.left + (nameContainerWidth / 2) - (nameSecondLineWidth / 2),
                    y: nameSecondLineY,
                    size: nameSize,
                    lineHeight: nameHeight,
                    maxWidth: nameContainerWidth,
                    font: DejaVuSerifCondensedBoldFont,
                    color: rgb(0, 0, 0)
                });
            }
        } else {
            pdfDoc.addPage(pdfDoc.getPages()[barcodesPages[barcodes[i].barcode]]);
        }
    }
    
    const pdfDataUri = await pdfDoc.saveAsBase64({ dataUri: true });
    document.getElementById('pdf').src = pdfDataUri;
}